import React, { Fragment, useEffect } from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { getAllergies } from '../../actions/allergy';
import AllergyForm  from './AllergyForm';
import AllergyItem  from './AllergyItem';

const Allergies = ({ getAllergies, allergy: { Allergies } }) => {
  useEffect(() => {
    getAllergies();
  }, [getAllergies]);

  return (
    <Fragment>
      <h1 className="large text-primary">Allergies</h1>
      <p className="lead">
        <i className="fas fa-user" /> Allergies Records
      </p>
      <AllergyForm />
      <div className="posts">
        {posts.map((allergy) => (
          <AllergyItem key={allergy._id} post={allergy} />
        ))}
      </div>
    </Fragment>
  );
};

Allergies.propTypes = {
  getAllergies: PropTypes.func.isRequired,
  allergy: PropTypes.object.isRequired
};

const mapStateToProps = (state) => ({
  allergy: state.allergy
});

export default connect(mapStateToProps, { getAllergies })(Allergies);
